--
-- Table structure for table `colegios`
--

DROP TABLE IF EXISTS `colegios`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `colegios` (
  `colegio_id` int(11) NOT NULL AUTO_INCREMENT,
  `asociacion_id` int(11) DEFAULT NULL,
  `nombres` varchar(80) DEFAULT NULL,
  `primer_apellido` varchar(80) DEFAULT NULL,
  `segundo_apellido` varchar(80) DEFAULT NULL,
  `nombre_colegio` varchar(255) DEFAULT NULL,
  `rfc_representante` varchar(13) DEFAULT NULL,
  `curp` varchar(18) DEFAULT NULL,
  `municipio_id` int(11) DEFAULT NULL,
  `cp_id` int(11) DEFAULT NULL,
  `calle` varchar(125) DEFAULT NULL,
  `rfc_colegio` varchar(13) DEFAULT NULL,
  `numero` varchar(20) DEFAULT NULL,
  `mapa` text,
  `telefono` varchar(10) DEFAULT NULL,
  `email` varchar(255) DEFAULT NULL,
  `pagina_web` varchar(255) DEFAULT NULL,
  `fecha` date DEFAULT NULL,
  `fecha_creacion` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `fecha_modificacion` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `periodo_mesa_directiva` int(11) DEFAULT NULL,
  `usuario_id` int(11) DEFAULT NULL,
  `acta_notariada` varchar(100) DEFAULT NULL,
  `acta_secretaria_economia` varchar(100) DEFAULT NULL,
  `estatus_colegio` int(11) DEFAULT '1',
  PRIMARY KEY (`colegio_id`),
  KEY `rfc` (`rfc_colegio`),
  KEY `municipio_id` (`municipio_id`),
  KEY `asociacion_id` (`asociacion_id`),
  CONSTRAINT `colegios_ibfk_1` FOREIGN KEY (`municipio_id`) REFERENCES `catalogos`.`municipios` (`municipio_id`),
  CONSTRAINT `colegios_ibfk_2` FOREIGN KEY (`asociacion_id`) REFERENCES `asociaciones` (`asociaciones_id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8;
